import React, { useState } from "react";
import "./Contact.scss";
import Main from "../../Main";

const defaultFormFields = {
  name: "",
  email: "",
  phone: "",
  message: "",
};

const Contact = () => {
  const [formFields, setFormFields] = useState(defaultFormFields);
  const [emailSent, setEmailSent] = useState(false);

  const resetFormFields = () => {
    setFormFields(defaultFormFields);
  };

  const handleChange = (event) => {
    const { name, value } = event.target;
    setFormFields({ ...formFields, [name]: value });
  };

  let url;
  if (process.env.NODE_ENV === "production") {
    url = process.env.REACT_APP_URL;
  } else {
    url = process.env.REACT_APP_DEV_URL;
  }

  const handleSubmit = async (event) => {
    event.preventDefault();

    const { name, phone, email, message } = formFields;

    try {
      axios
        .post("/email", { name, phone, email, message })
        .then((res) => {
          console.log(res);
          setEmailSent(true);
        })
        .catch((err) => {
          console.log("Error!");
        });
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <Main pageTitle={"Contact"} pageClass={"contact"}>
      <div className="container">
        <h1>Contact</h1>
        <h2>How to book an appointment</h2>
        <div className="contact-details">
          <div className="contact-detail">
            <i class="fa-solid fa-2x fa-map-pin"></i>
            <p>123 Street, Anywhere, EC1M 2AY</p>
          </div>
          <div className="contact-detail">
            <i class="fa-solid fa-2x fa-phone"></i>
            <p>07123456789</p>
          </div>
          <div className="contact-detail">
            <i class="fa-2x fa-regular fa-envelope"></i>
            <p>contact@earhealth.co.uk</p>
          </div>
        </div>

        <div className="form-container">
          <h2>You can also use our contact form</h2>
          {!emailSent ? (
            <>
              <h2>Contact us</h2>

              <form onSubmit={handleSubmit}>
                <div className="contact-input">
                  <label htmlFor="name">Name</label>
                  <input
                    id="name"
                    name="name"
                    type="text"
                    onChange={handleChange}
                    value={formFields.name}
                  />
                </div>

                <div className="email-and-phone">
                  <div className="contact-input half">
                    <label htmlFor="email">Email</label>
                    <input
                      id="email"
                      name="email"
                      type="email"
                      onChange={handleChange}
                      value={formFields.email}
                    />
                  </div>

                  <div className="contact-input half">
                    <label htmlFor="phone">Phone</label>
                    <input
                      id="phone"
                      name="phone"
                      type="text"
                      onChange={handleChange}
                      value={formFields.phone}
                    />
                  </div>
                </div>

                <div className="contact-input">
                  <label htmlFor="message">Message</label>
                  <textarea
                    id="message"
                    name="message"
                    type="textarea"
                    onChange={handleChange}
                    value={formFields.message}
                  />
                </div>

                <button>Submit</button>
              </form>
            </>
          ) : (
            <>
              <h2>Thank you for getting in touch</h2>
            </>
          )}
        </div>
      </div>
    </Main>
  );
};

export default Contact;
